Brian Patrick Carroll (born May 13, 1969), better known by his stage name Buckethead, is a guitarist and multi-instrumentalist who has worked within many genres of music. He has released 94 studio albums, four special releases and one EP. He has performed on over 50 more albums by other artists. His music spans such diverse areas as progressive metal, funk, blues, jazz, bluegrass, ambient, and avant-garde music.

Buckethead is famous for wearing a KFC bucket on his head, emblazoned with an orange bumper sticker reading FUNERAL in capital black block letters, and an expressionless plain white mask which, according to Buckethead, was inspired by his seeing Halloween 4: The Return of Michael Myers. At one point, he changed to a plain white bucket that no longer bore the KFC logo, but subsequently reverted to his trademark KFC bucket. He also incorporates nunchaku and robot dancing into his stage performances.

As an instrumentalist, Buckethead has received critical acclaim for his electric guitar playing, and is considered one of today's more innovative guitarists. He has been voted number 8 on a list in GuitarOne magazine of the &quot;Top 10 Fastest Guitar Shredders of All Time&quot; as well as being included in Guitar World's lists of the &quot;25 all-time weirdest guitarists&quot; and the &quot;50 fastest guitarists of all time&quot;.

Buckethead cites a wide variety of musical influences, including Michael Jackson, Parliament-Funkadelic, Shawn Lane, Michael Schenker, Uli Jon Roth, Paul Gilbert, Yngwie Malmsteen, Eddie Hazel, Randy Rhoads, Larry LaLonde, Mike Patton, James Cutri, Louis Johnson, Jimi Hendrix, Jennifer Batten, The Residents, Eddie Van Halen and Angus Young, as well as the many artists he has collaborated with over the years.

In addition to his musical influences, Buckethead cites a diverse range of non-musical influences manifested on several ways out of which dedicated songs to said inspirations have been a staple of Buckethead's discography with particular attention to basketball players like Michael Jordan (song &quot;Jordan&quot;), George Gervin (on &quot;Iceman&quot;), Blake Griffin (on &quot;Crack the Sky&quot;), &quot;Pistol&quot; Pete Maravich (on &quot;The Mark of Davis&quot;), and LeBron James (with four songs dedicated to him). Other influences include martial artist and actor Bruce Lee (on &quot;The Game of Death&quot; song and inspiration behind the use of nunchakus on stage), author H. P. Lovecraft (on the &quot;Lurker at the Threshold&quot; suite), numerous science fiction and horror TV shows and movies including Little House on the Prairie, and Giant Robot (mentioned on several songs, albums, and episodes shown on stage).
